import React from "react";
export default function ThankYou() {
  return (
    <>
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-8">
            <div className="card p-5 mt-5">
              <h3>Thank You for purchaseing the items</h3>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
